import { t } from 'i18next';
import React from 'react';
import Footer_image from '../images/Footer_image.png'
import './Footer.css'
import { useTranslation } from 'react-i18next';
const Footer = () => {
	const { t } = useTranslation();
	return (
		<div className='Footer'>
			<p className='Footer_text'>
				<h3 className='h3_text'>{t("What our clients say about our awesome solutions_msg")}</h3>
				<p>{t("To take a trivial example_msg")}</p>
				<p>{t('Lorem ipsum_msg')}</p>
				<p>{t('Lorem ipsum_msg')}</p>
				<p>{t('Lorem ipsum_msg')}</p>
			</p>
			<div className='Footer_img'>
				<img src={Footer_image} alt="Footerimage" />
			</div>
		</div>

	)
}
export default Footer;
